export default function App() {
  return (
    <div className="container">
      <div className="card">
        <h1> Apps</h1>
        <hr class="firsthr" />
      </div>
    </div>
  );
}
function Listapp() {
  return (
    <div className="app">
      <div className="first one-name">
        <i class="fa-brands fa-slack fa-spin-pulse" style="color: #63E6BE;"></i>
        <p>Slack</p>
      </div>
    </div>
  );
}
